        public override bool GensBool { get => LakeGen; set => LakeGen = value; }
        public override string NameGen => "[Synergia] Lake in hell";
        public override bool Do_MakeGen(GenerationProgress progress) {
            if (progress != null) {
                progress.Message = "";
                progress.Set(0.99f);
            }

            int startX = Main.maxTilesX - 1036; // <--- До какой точки X будет очистка
            int startY = Main.maxTilesY - 44; // <--- Самая нижния правая точка в аду по Y

            int EndX = Main.maxTilesX - 800; // <--- Самая нижния правая точка в аду по X с которой начнетса генерация
            int EndY = Main.maxTilesY - 162; // <--- До какой точки Y будет очистка

            HellLakeX = EndX;
            HellLakeY = startY;
            
            int width = LakeTile.GetLength(1);
            int height = LakeTile.GetLength(0);

            WorldHelper.Cleaning(EndX, startY, startX, EndY, TileID.Ash, TileID.Hellstone, TileType<Sinstone>(), TileID.AshGrass, TileID.Stone, 82, 637, 185, 634, 28, 75);

            for (int y = 0; y < height; y++) {
                for (int x = 0; x < width; x++) {
                    int worldX = HellLakeX - 236 + x;
                    int worldY = HellLakeY - y;

                    if (!WorldGen.InWorld(worldX, worldY, 10)) {
                        continue;
                    }

                    Tile tile = Framing.GetTileSafely(worldX, worldY);
                    tile.ClearEverything();

                    switch (LakeTile[y, x]) {
                        case 0: break;
                        case 1: tile.TileType = (ushort)TileType<Sinstone>(); tile.HasTile = true; break;
                        case 2: tile.TileType = TileID.Ash; tile.HasTile = true; break;
                        case 3: tile.TileType = TileID.Hellstone; tile.HasTile = true; break;
                        case 4: tile.TileType = (ushort)TileType<SinstoneMagma>(); tile.HasTile = true; break;
                        case 5: tile.TileType = Roa.Find<ModTile>("BackwoodsStone").Type; tile.HasTile = true; break;
                        case 6: tile.TileType = (ushort)TileType<BurntCobble>(); tile.HasTile = true; break;
                        case 7: tile.TileType = TileID.AshWood; tile.HasTile = true; break;
                        case 8: WorldGen.PlaceTile(worldX, worldY, 19, false, false, -1, 47); break;
                        case 9: tile.TileType = (ushort)TileType<AncientDebris>(); tile.HasTile = true; tile.IsActuated = true; break;
                        case a: tile.TileType = (ushort)TileType<SinstoneBrick>(); tile.HasTile = true; tile.IsActuated = true; break;
                        case b: tile.TileType = (ushort)TileType<ResistantWood>(); tile.HasTile = true; tile.IsActuated = true; break;
                        case c: tile.TileType = (ushort)TileType<ResistantWood>(); tile.HasTile = true; break;
                        case Q: tile.LiquidType = LiquidID.Lava; tile.LiquidAmount = 255; break;
                    }
                    switch (LakeSlope[y, x]) {
                        case 0: break;
                        case 1: tile.IsHalfBlock = true; break;
                        case 2: tile.Slope = SlopeType.SlopeDownRight; break;
                        case 3: tile.Slope = SlopeType.SlopeUpLeft; break;
                        case 4: tile.Slope = SlopeType.SlopeUpRight; break;
                        case 5: tile.Slope = SlopeType.SlopeDownLeft; break;
                    }
                    switch (LakeWall[y, x]) {
                        case 0: break;
                        case 1: tile.WallType = Roa.Find<ModWall>("GrimstoneWall").Type; break;
                        case 2: tile.WallType = (ushort)WallType<SinstoneBrickWall>(); break;
                        case 3: tile.WallType = (ushort)WallType<BurntCobbleWall>(); break;
                        case 4: tile.WallType = WallID.AshWood; break;
                        case 5: tile.WallType = WallID.AshWoodFence; break;
                        case 6: tile.WallType = WallID.EbonwoodFence; break;
                    }
                }
            }
            int posX = HellLakeX - 236;
            WorldGen.PlaceChest(posX + 132, HellLakeY - 12, TileID.Containers, false, 2);
            return true;
        }
    }
}
